const Login = () => {
  return (
    <div>
      <fieldset>
        <legend>Login</legend>
        <form>
          <label>UserName</label>
          <input className="fields" type="text"></input>

          <label>Password</label>
          <input type="password"></input>
        </form>
      </fieldset>
    </div>
  );
};

export default Login;
